script: |
  super -f text -I q5574.spq | sort > q5574.out

inputs:
  - name: q5574.spq
    data: |
      SELECT - 14 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 NOT IN ( + col0, col1, + col1, + col1 - + 36, - 39 * - + 49 + - + col0 / - - col1 * + col0 );
  - name: tab2

outputs:
  - name: q5574.out
    data: |
